(164388, 'EC2BE748-2C85-46DF-99D2-E0C577046D24', 'Good morning love. Just got home from joe and Elizabeth''s. Had a great dinner and then dip in the hot tub (in the rain). I even baked banana bread. Had good conversations with Elizabeth and she is very supportive of the move.  Made arrangements for a truck and help to move on Saturday, so we should be set.  Nathan went to marlas last night and then went to magic...without discussing with me. Last night that is happening. I had gary and his son jake for brunch, and woke up and started this new online cycling training service.... Which is really good.  Jonah and I went to the city and hung in the mission, then went to see Creed at the Roxie...was good to give him a bit of city exposure and enjoyed the movie. It is super rainy, so will do rainy day things tomorrow.  Also working on a little contract for the boys...will send you a draft. Want to discuss with them before the move so we can begin figuring out stuff this week.  I miss you and miss having the cadence of banter throughout the day. Was sad when I realized you aren''t back until Thursday. I don''t want to take any time together for granted. I love you and am so happy to be moving into our place this weekend. Crazy wonderful. ', 'David', 'Nitzan', '2016-01-17T23:39:31'),
